package com.team33.FDMGamification;

import org.junit.jupiter.api.Test;
import org.junit.runner.RunWith;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.core.io.ClassPathResource;
import org.springframework.test.context.ActiveProfiles;
import org.springframework.test.context.junit4.SpringRunner;
import org.springframework.util.Base64Utils;

import java.io.File;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;

@SpringBootTest
@RunWith(SpringRunner.class)
@ActiveProfiles("test")
class FdmGamificationApplicationTests {

	@Test
	public void readResourceFile_Successful() throws IOException {
		File resource = new ClassPathResource("static/images/challengeImages/defectSeverity.jpg").getFile();
		Path filePath = resource.toPath();
		String mimeType = Files.probeContentType(filePath);
		String base64 = Base64Utils.encodeToString(Files.readAllBytes(resource.toPath()));

		assertTrue(resource.exists());
		assertEquals(resource.getName(), "defectSeverity.jpg");
		assertEquals(mimeType, "image/jpeg");
		assertEquals(base64, "");
	}

}
